	CHRONOS_URI = ENV["CHRONOS_URI"]
	def home
		rest_resource = RestClient::Resource.new(CHRONOS_URI+"/scheduler/jobs", "", "")
		jobList = rest_resource.get
		@jobList = JSON.parse(jobList)
		@failureCount = 0
		@successCount = 0
		@idleCount = 0
		@jobList.each do |job|
			if (job['lastSuccess'] <=> job['lastError']) == 1
				@successCount += 1
			elsif (job['lastSuccess'] <=> job['lastError']) == -1
				@failureCount += 1
			else
				@idleCount += 1
			end
		end 
		@failedJobs  = @failureCount
		@successJobs = @successCount
		@idleJobs    = @idleCount
		@totalJob    = @successJobs + @failedJobs + @idleJobs 
		rescue => ex
			 render :template => "errors/internal_server_error"
	end
	def getStats
		rest_resource = RestClient::Resource.new(CHRONOS_URI+"/scheduler/jobs", "", "")
		jobList = rest_resource.get
		@jobList = JSON.parse(jobList)
		rescue => ex
			 render :template => "errors/internal_server_error"
	end
end
